import { useParams } from "react-router-dom";
import timelineElements from "../timelineElements.js";
import { APIProvider, Map } from '@vis.gl/react-google-maps';
import PhotoAlbum from 'react-photo-album';

function Wspomnienie() {
    const API_KEY = "AIzaSyAxnnVtUtw8tvuZg28S9VHTsmJ89ai1byk";
    const params = useParams();
    const element = timelineElements[params.wspomnieniaId-1];
    const photos = [
        {src: "https://www.dropbox.com/scl/fi/y0ee4o1xs2zbrw7k30fez/IMG_20240212_133958.jpg?rlkey=g3lr21ujj1va6zq4zl273y3kx&raw=1", width: 200, height: 400}
    ]
    return (
        <div>
        <div className="map">
        <APIProvider apiKey={API_KEY}>
            <Map
            defaultCenter={{lat: 22.54992, lng: 0}}
            defaultZoom={3}
            gestureHandling={'greedy'}
            disableDefaultUI={true}
            />
        </APIProvider>
        </div>
        <PhotoAlbum className="photo-album" layout="rows" photos={photos}/>
        </div>
    );
}

export default Wspomnienie;
